oxy_webhelp_navlinks = {"aws_rds_recovery-d22908e13341":{"topics":[{"title":"Recovery options for Amazon RDS","shortdesc":"<p class=\"shortdesc\"><span class=\"ph\">RSC<\/span> provides two recovery options for Amazon RDS and Aurora         databases. Point-in-time export allows recovery within the same region based on continuous         backups, while snapshot export supports recovery within the same region or across regions         using on-demand or scheduled snapshots.<\/p>","href":"saas\/aws_rds_recovery_options.html","attributes":{"data-id":"aws_rds_recovery_options"},"menu":{"hasChildren":false},"tocID":"aws_rds_recovery_options-d22908e13358","topics":[]},{"title":"Exporting Amazon RDS snapshots","shortdesc":"<p class=\"shortdesc\">To create a point-in-time copy of an Amazon RDS database, export an Amazon RDS         on-demand, scheduled, or continuous snapshot. <span class=\"ph\">For Amazon RDS PostgreSQL             databases, <span class=\"ph\">RSC<\/span> supports exporting snapshots from primary and archived             snapshots.<\/span><\/p>","href":"saas\/aws_rds_exporting_snapshots.html","attributes":{"data-id":"aws_rds_exporting_snapshots"},"menu":{"hasChildren":false},"tocID":"aws_rds_exporting_snapshots-d22908e13371","next":"aws_rds_exporting_snapshots-d22908e13371"}]}};